import "./Footer.css";

function Footer() {
    /*
    Footer component in order to give 
    information about developer
    */
   
    return (
        <footer className="footer">
            <p className="footer-text">This application developed by zThyphon</p>
            <p className="copyright-text">© 2023</p>
        </footer>
    );
}  

export default Footer;
